import React from 'react';

function TextBox() {
    return (
        <div>
            <h2>Please input your preferences</h2>
            <form>
                <label>
                    Your Location:
                    <input type="text" name="location" />
                </label>
                <br />
                <label>
                    Meal Preferences:
                    <input type="text" name="mealPreferences" />
                </label>
                <br />
                <input type="submit" value="Submit" />
            </form>
        </div>
    );
}

export default TextBox;
